import React from "react";
import { Accordion, ListGroup } from "react-bootstrap";
import { Link } from "react-router-dom";

const MobileFooterNav = () => {
    return (
        <Accordion defaultActiveKey="1" flush className="bg-danger">
            <Accordion.Item eventKey="0">
                <Accordion.Header>
                    More about&nbsp;<Link to='/'>E-Shop</Link>
                </Accordion.Header>
                <Accordion.Body>
                    <ListGroup variant="flush" className="border-0">
                        <ListGroup.Item><a href ='/'>ABOUT US</a></ListGroup.Item>
                        <ListGroup.Item><a href ='/'>POLICY</a></ListGroup.Item>
                        <ListGroup.Item><a href ='/'>FAQs</a></ListGroup.Item>
                        <ListGroup.Item><a href ='/'>CONTACT</a></ListGroup.Item>
                        <ListGroup.Item><a href ='/'>JOIN US</a></ListGroup.Item>
                    </ListGroup>
                </Accordion.Body>
            </Accordion.Item>
        </Accordion>
    )
}

export default MobileFooterNav;
